import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css';

class NavBar extends Component {
  render() {
    return (
      <nav className='navbar-nav'>
        <div className='logo'>
          <div className='title'>Baby Namin'</div>
        </div>
        <div className='navbar-links'>
          <Link to='/babynames' className='nav-link'>Sign-In</Link>
          <Link to='/babynames/:userID' className='nav-link'>Home</Link>
          <Link to='/babynames/:userID/lists' className='nav-link'>All Lists</Link>
        </div>
      </nav>
    );
  }
}

export default NavBar;
